import React from 'react'
import './Modal.css';
import { Data } from './Data';
function Modal(){
    return(
    <Data>
      <div className='wrapper'>
        <h1>Profile</h1>
            <div>
                <img src='/me.png' className='img-me' alt='img-me'/>
                <h2>Vu Truong Son</h2>
                <h4>Front-end Developer</h4>
            </div>
      </div>
    </Data>
    )
}
export default Modal;
